import React from 'react';
import './_Quotes.scss';

const Quotes = () => {
    return (
    <> 
    <section className="quote">
        <div className="quote--wrapper">
            <p className="quote__content">"There is something here for everyone! Find your sound, create your own wave find music and a sound that speaks to you. That's why we are here that is what Slotify is all about."</p>
            <p className="quote__author">Thomas McKyer</p>
            <p className="quote__author--title">Founder, Slotify</p>
        </div>
    </section>
    </>
    )
}

export default Quotes
